	return ${array_cable_system_cost_total_check}+${export_cable_system_cost_total_check}+
		${cable_protection_cost_total_check}+${offshore_substation_cost_total_check}+
		${onshore_substation_cost_total_check}+${onshore_transmission_infrastructure_cost_total_check}
		+${other_elec_infra_cost_total};
};

equations {'elec_infras_cost'} = define() {
	return ?${elec_infras_cost_method}
			[
				${elec_infras_cost_input}*${system_capacity},
				${elec_infras_cost_input},
				${elec_infras_cost_modeled},
				${elec_infras_cost_total}
			];
};

equations {'itemized_check_elec_infras'} = define() {
	if (${balance_of_system_cost_override}!=1)
	{
		return ?${elec_infras_cost_method}
				[
					0,
					0,
					2,
					1
				];
	}
	else
	{
		return 2;
	}
};

equations{'elec_infras_override'} = define() {
	return ${balance_of_system_cost_override};};

